import React, { useState, useEffect } from "react";

function DetailedSchedule() {
  const [schedule, setSchedule] = useState(null);
  const [error, setError] = useState(null);



  const { schedule: details, shows, user } = schedule;

  return (
    <div>
      <h1>Detailed Music Festival Schedule</h1>
      <h2>{details.title}</h2>
      <p>Date: {details.date}</p>
      <h3>Created By:</h3>
      <p>
        {user.first_name} {user.last_name}
      </p>
      <h3>Shows:</h3>
      <ul>
        {shows.map((show) => (
          <li key={show.id}>
            <h4>{show.artist}</h4>
            <img
              src={`http://localhost:3000${show.artist_image_url}`}
              alt={`${show.artist} image`}
            />
            <p>Show Details:</p>
            <img
              src={`${show.image_url}`}
              alt={`Show image for ${show.artist}`}
            />
            <p>Date: {show.date}</p>
            <p>Time: {show.time}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DetailedSchedule;
